const Home = () => {
    return (
        <div>
            <img className="ui fluid image" src="/early_morning.jpg" />
            <div className="ui segment">
                <div className="ui two column very relaxed grid">
                    <div className="column">
                        <img className="ui fluid image" src="/kareem.jpeg" />
                        <h3></h3>
                    </div>
                    <div className="column">

                    </div>
                </div>
                <div className="ui vertical divider"></div>
            </div>
        </div>
    );
};

export default Home;
